function TodoItem({ todo, onChange, onDelete }) {
  return (
    <div>
      <label>
        <input
          type="checkbox"
          checked={todo.isCompleted}
          onChange={(e) => {
            onChange({
              ...todo,
              isComplated: e.target.checked,
            });
          }}
        />
        {todo.text}
        <button
          onClick={() => {
            onDelete(todo);
          }}
        >
          X
        </button>
      </label>
    </div>
  );
}

export default TodoItem;
